import React from 'react';
import "./Jambotron.css";

function Jumbotron(){
  return(
    <div className="jumbotron jumbotron-fluid">
      <div className="container">
        <h1 className="display-3">Welcome!</h1>
      </div>
    </div>
  );
}

export default Jumbotron;
